import React from 'react';

import { makeStyles } from "@material-ui/core/styles";
import { Navbar } from "./navbar/components/Navbar";
import { ProfilePic } from "./profile_pic/components/ProfilePic";
import Grid from "@material-ui/core/Grid";

export const App = () => {
  return (
    <div className="App">
      <Navbar />
      <Grid container>
        <Grid item xs={1}></Grid>
        <Grid item xs={3}>
          <ProfilePic />
        </Grid>
      </Grid>
    </div>
  );
}

export default App;
